import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Router } from 'wouter'; ;


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <Router>
    <App />
  </Router>
);

